{
    return (
        <>
            <h1>Coursses Page</h1>
            <table className="table table-striped">
                <tr>
                    <th> ID</th>
                    <th> Name</th>
                    <th> Description</th>
                    <th> Duration</th>
               
                </tr>
                <td>
                    <td>1</td>
                    <td></td>
                    <td>1</td>
                    <td>1</td>
                </td>
            </table>
        </>
    );
}
export default Coursses;
